import react from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
    return (
        <nav>
            <Link to='/'>Home</Link>
            <Link to='/posts'>Posts</Link>
            <Link to='/profile'>Profile</Link>
            <Link to='/register'>Register</Link>
        </nav>
    )
}

export default Navbar
